import React from 'react';
import data from './data.json'
import './App.css';
import { SocialIcon } from 'react-social-icons';


function App() {
  return (
    <div className="App">
      <div className="navigation" />
      <div className="fullPage" >
        <h1 className="title">
          {data.title}
        </h1>
      </div>
      <div>
        <h2>
          {data.subTitle}
        </h2>
      </div>
      <div>
      <SocialIcon url="https://twitter.com/jaketrent" />
      </div>
      <div className="fullPage" />
      <div className="fullPage" />
    </div>
  );
}

export default App;
